window.bookSummaryJSON = "<p><b>The Furyck Saga continues with this exciting fifth volume in A.E. Rayne’s epic fantasy adventure!</b></p> <p>Escaping Hallow Wood with a wounded Thorgils, Aleksander and Jael find themselves stuck in Harstad, desperate to get the Book of Aurea back to Andala before the dragur find them again.</p> <p>Waiting in Hest for Eadmund, Evaine is oblivious to everyone’s worry over Morana, who is showing little sign of recovery. Jaeger is panicking, knowing that without someone to read the Book of Darkness, they are defenseless, vulnerable to an attack from Draguta, should she return.</p> <p>In Andala, the sickness has taken hold, and more and more people are being carried into the ship sheds each day. Helpless to contain it, Axl and Gant are working hard to repair the fort, making plans to meet the Vandaals, unaware that a new enemy has emerged to threaten them all.</p> <p>And still bound to Evaine, Eadmund is on his way to be reunited with her when he hears another voice in his head, calling to him....</p>"; 
